import "./App.css";
import Carausol from "./Components/Carausol";
import Homepage from "./Components/Homepage";
import NavBar from "./Components/NavBar";

function App() {
  return (
    <div onLoad={scwidth}>
      <NavBar />
      <Homepage />
      <Carausol />
    </div>
  );
}

export default App;
